# URL của VictoriaMetrics Push API
victoria_metrics_url = 'http://localhost:37275/api/v1/import/prometheus'

def generate_cyclic_load_data(min_value_range, max_value_range, steps_per_cycle):
    """
    Tạo dữ liệu chu kỳ cho tải trọng máy ép.
    - min_value_range: khoảng giá trị cực tiểu (vd: [900, 1100]).
    - max_value_range: khoảng giá trị cực đại (vd: [4000, 4500]).
    - steps_per_cycle: số bước trong mỗi chu kỳ (vd: 10 bước).
    """
    min_value = random.randint(min_value_range[0], min_value_range[1])
    max_value = random.randint(max_value_range[0], max_value_range[1])
    
    print(f"Min value selected: {min_value}")
    print(f"Max value selected: {max_value}")
    
    # Sinh các giá trị tăng dần từ min_value đến max_value
    increasing_part = [int(min_value + i * (max_value - min_value) / (steps_per_cycle - 1)) for i in range(steps_per_cycle)]
    
    print(f"Increasing part: {increasing_part}")
    
    # Ghép phần giảm dần lại với phần tăng dần
    decreasing_part = increasing_part[::-1]
    
    print(f"Decreasing part: {decreasing_part}")
    
    # Kết hợp hai phần thành một chu kỳ hoàn chỉnh
    full_cycle = increasing_part  # Loại bỏ phần tử trùng lặp ở giữa
    
    return full_cycle

# Hàm generate tải trọng theo chu kỳ từ mảng đầu vào
def generate_load_cycle(load_values, cycle_duration):
    """
    Sinh ra giá trị tải trọng từ mảng đầu vào theo chu kỳ với mỗi bước cách nhau bởi cycle_duration giây.
    - load_values: mảng các giá trị tải trọng.
    - cycle_duration: thời gian giữa mỗi lần sinh giá trị (giây).
    """
    while True:
        for load in load_values:
            yield load  # Sinh ra giá trị tiếp theo từ mảng
            time.sleep(cycle_duration)  # Chờ một khoảng thời gian giữa các bước

# Hàm gửi dữ liệu đến VictoriaMetrics
def send_to_victoriametrics(metric_name, load_value, timestamp):
    """
    Gửi dữ liệu tải trọng và timestamp đến VictoriaMetrics.
    """
    data = f'{metric_name} {load_value} {int(timestamp.timestamp())}\n'
    
    try:
        response = requests.post(victoria_metrics_url, data=data)
        if response.status_code == 200 or response.status_code == 204:
            print(f"Dữ liệu đã được gửi: {data.strip()}")
        else:
            print(f"Lỗi khi gửi dữ liệu: {response.status_code} - {response.text}")
    except Exception as e:
        print(f"Lỗi kết nối tới VictoriaMetrics: {e}")

